import React from "react";

export const ListResult = ({ url, title, snippet }) => {

	if (title.length > 59){
		title += "...";
	}

	if (snippet.length > 349){
		snippet += "...";
	}

	const formattedUrl = url.replace(/\//g, " › ");

	return (
		<div style={{ border: "1px solid black" }}>
			<p>{formattedUrl}</p>
			<p><a href={`//${url}`}>{title}</a></p>
			<p>{snippet}</p>
		</div>
	)
}
